// TherapistDashboardHome.js
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Calendar from 'react-calendar';
import axios from 'axios';
import '../styles/therapistDashboard.css';

function TherapistDashboard() {
  const navigate = useNavigate();
  const [calendarDate, setCalendarDate] = useState(new Date());
  const [showInvitationModal, setShowInvitationModal] = useState(false);
  const [invitationEmail, setInvitationEmail] = useState('');
  const [invitationMsg, setInvitationMsg] = useState('');

  const handleButtonClick = (route) => {
    navigate(route);
  };

  const openInvitationModal = () => {
    setShowInvitationModal(true);
  };

  const closeInvitationModal = () => {
    setShowInvitationModal(false);
    setInvitationEmail('');
    setInvitationMsg('');
  };

  const handleSendInvitation = async () => {
    try {
      const token = localStorage.getItem('token');
      // Se envía el email del paciente al endpoint de invitaciones
      const response = await axios.post(
        'http://localhost:5000/api/invitations',
        { email: invitationEmail },
        { headers: { 'x-auth-token': token } }
      );
      setInvitationMsg('Invitación enviada con éxito');
    } catch (error) {
      console.error('Error al enviar invitación:', error);
      setInvitationMsg('Error al enviar la invitación');
    }
  };

  return (
    <div className="th-home-container">
      <header className="th-home-header">
        <h1>Dashboard Terapeuta</h1>
      </header>
      <div className="th-home-content">
        <div className="th-home-buttons">
          <button onClick={() => handleButtonClick('/therapist/patients')} className="th-home-button">
            <i className="fa fa-users"></i>
            <span>Lista de Pacientes</span>
          </button>
          <button onClick={() => handleButtonClick('/therapist/routines')} className="th-home-button">
            <i className="fa fa-clock-o"></i>
            <span>Rutinas y Tiempo</span>
          </button>
          <button onClick={() => handleButtonClick('/therapist/interests')} className="th-home-button">
            <i className="fa fa-heart"></i>
            <span>Intereses</span>
          </button>
          <button onClick={() => handleButtonClick('/therapist/satisfaction')} className="th-home-button">
            <i className="fa fa-smile-o"></i>
            <span>Satisfacción</span>
          </button>
          <button onClick={() => handleButtonClick('/messaging')} className="th-home-button">
            <i className="fa fa-comments"></i>
            <span>Mensajería</span>
          </button>
          <button onClick={openInvitationModal} className="th-home-button">
            <i className="fa fa-envelope"></i>
            <span>Generar Invitación</span>
          </button>
        </div>
        <div className="th-home-calendar">
          <Calendar onChange={setCalendarDate} value={calendarDate} />
        </div>
      </div>

      {showInvitationModal && (
        <div className="th-home-modal-overlay">
          <div className="th-home-modal">
            <h2>Generar Invitación</h2>
            <p>Introduce el correo electrónico del paciente:</p>
            <input
              type="email"
              value={invitationEmail}
              onChange={(e) => setInvitationEmail(e.target.value)}
              placeholder="correo@ejemplo.com"
            />
            <div className="th-home-modal-buttons">
              <button onClick={handleSendInvitation}>Enviar Invitación</button>
              <button onClick={closeInvitationModal}>Cancelar</button>
            </div>
            {invitationMsg && <p className="th-home-modal-msg">{invitationMsg}</p>}
          </div>
        </div>
      )}
    </div>
  );
}

export default TherapistDashboard;
